import CustomerHeader from "./CustomerHeader";

function Dashboard_Customer()
{
    return(
        <>
            <CustomerHeader />
                <div className="container" style={{"margin-top":"100px"}}>
                    <h3 style={{"color":"orangered"}}>Wants to Move...</h3>
                </div>
        </>
    )
}
export default Dashboard_Customer;
